using System;
using System.Collections.Generic;
using Xamarin.Forms;
using System.IO;

namespace FFImageLoading.Forms.Sample
{
    public partial class StreamListPageCell : ViewCell
    {
        const string base64Image = "";
        readonly byte[] imageData = Convert.FromBase64String(base64Image);

        public StreamListPageCell()
        {
            InitializeComponent();
        }

        protected override void OnBindingContextChanged()
        {
            base.OnBindingContextChanged();

            var item = BindingContext as ListPageModel.ListItem;
            if (item == null)
                return;

            Image.Source = ImageSource.FromStream(() => { return new MemoryStream(imageData); });
            Label.Text = "Stream";
        }
    }
}
